import React from "react";

const PlanetOrbit = () => {
  return (
    <div className="orbit">
      <div className="orbit__outer">
        <div className="orbit__inner first"></div>
        <div className="orbit__animation"></div>
        <div className="orbit__inner -second"></div>
      </div>
    </div>
  );
};

export default PlanetOrbit;
